import React from 'react';
import logo from './logo.svg';
import Employees from './components/Employees/Employees';
import './App.css';
import Navbar from './components/Navbar/Navbar';

function App() {
  return (
    <div className="App">
      <Navbar />
      <Employees />
    </div>
  );
}

export default App;
